@import "../common/colors";
@import "../common/styles";

.header {
  padding: 30px 0;
  background: $secondary_white;
  border-top: 10px solid $primary_gray;

  @include media-breakpoint-up(md) {
    & .profile-image {
      margin-right: 30px;
    }
  }

  & img {
    vertical-align: middle;
    border-style: none;
    border-radius: 50%;
    border: 2px solid $primary_gray;
    box-shadow:0px 0px 10px 10px $secondary_gray inset;
    box-shadow:0px 2px 10px 2px $light_gray;
  }

  & .profile-content {
    display: block;

    & .name {
      color: $secondary_gray;
      font-size: 38px;
      margin-bottom: 5px;
      margin-top: 30px;
    }

    & .desc {
      color: #778492;
      font-family: "Lato", arial, sans-serif;
      font-weight: 400;
      font-size: 24px;
      margin-top: 0;
      margin-bottom: 15px;
    }
  }

  & .social a {
    background: $ternary_gray;
    width: 36px;
    height: 36px;
    display: inline-block;
    -webkit-border-radius: 50%;
    -moz-border-radius: 50%;
    -ms-border-radius: 50%;
    -o-border-radius: 50%;
    border-radius: 50%;
    text-align: center;

    & * {
      color: $primary_white;
    }

    &:hover {
      background: $primary_gray;
    }

    & .svg-inline--fa {
      font-size: 20px;
      margin-top: 5px;
      display: inline-block;
      height: 1em;
    }
  }

  & a.btn {
    -webkit-transition: all 0.3s ease-in-out;
    -moz-transition: all 0.3s ease-in-out;
    -ms-transition: all 0.3s ease-in-out;
    -o-transition: all 0.3s ease-in-out;
    transition: all 0.3s ease-in-out;
    font-family: "Montserrat", arial, sans-serif;
    padding: 8px 16px;

    & .svg-inline--fa {
      margin-right: 5px;
      position: relative;
      top: -2px;
      display: inline-block;
      font-size: inherit;
      height: 1em;
      vertical-align: -0.125em;
    }
  }

  & .btn-cta-primary {
    background: $primary_green;
    border: 1px solid $primary_green;
    color: $primary_white !important;
    font-weight: 600;
    text-transform: uppercase;

    & * {
      color: $primary_white;
    }
  }
}

